// Registration.js
import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios'; // for making HTTP requests

const Registration = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [mobileNumber, setMobileNumber] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    // Create user object
    const newUser = {
      firstName,
      lastName,
      email,
      mobileNumber,
      username,
      password: ''
    };

    try {
      // Send POST request to backend server
      const response = await axios.post('http://localhost:5000/register', newUser);
      console.log(response.data); // Assuming backend sends back a success message
	  alert('Registration Successful');
	  setFirstName({firstName: ''});
      // Optionally: Redirect to a success page or show a success message
    } catch (error) {
      console.error('Registration failed:', error);
      // Handle error (show error message, etc.)
    }
  };

  return (
    <div>
      <h2>Registration</h2>
      <form onSubmit={handleSubmit}>
        <label>
          First Name:
          <input type="text" value={firstName} onChange={(e) => setFirstName(e.target.value)} required />
        </label>
        <br />
        <label>
          Last Name:
          <input type="text" value={lastName} onChange={(e) => setLastName(e.target.value)} required />
        </label>
        <br />
        <label>
          Email:
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
        </label>
        <br />
        <label>
          Mobile Number:
          <input type="tel" value={mobileNumber} onChange={(e) => setMobileNumber(e.target.value)} required />
        </label>
        <br />
        <label>
          Username:
          <input type="text" value={username} onChange={(e) => setUsername(e.target.value)} required />
        </label>
        <br />
        <label>
          Password:
          <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
        </label>
        <br />
        <button type="submit">Register</button>
      </form>
      <p>Already have an account? <Link to="/login">Login here</Link></p>
    </div>
  );
};

export default Registration;
